4) Ne rentrent  aux 8703.21.71.00  et 8703.21.79.00  que les véhicules  «Kart  Cross»  neufs  et usagés  
répondant  aux caractéristiques  ci-après  et importés  à l’état monté  : 
- Châssis  et structure  tubulaires  ; 
- Deux  roues  motrices  ; 
- Suspension  double  triangulation  AV (2 amortisseurs)  et AR (4 amortisseurs)  ; 
- Moteur  à essence  même  rénové,  d’une  cylindrée  égale  ou inférieure  à 1000  cm3, sans capot  ; 
- Sièges  non réglables  ; 
- Rayon  de braquage  = 2,40 m  ; 
- Longueur hors -tout égale  ou inférieure  à 2,65 m ; 
- Largeur  hors-tout = 1,60 m ; 
- Hauteur  hors-tout = 1,20 m ; 
- Absence  de carrosserie  (toit rudimentaire)  ; 
- Absence  de portières  véritables  (filets  latéraux)  ; 
- Absence  de vitres  (pare -brise remplacé  par une grille anti-projection)  ; 
- Absence  de coffre  ; 
- Roues  sans garde -boue  ; 
- Vitesse  maximum  = 90 km/h.

5) Ne rentrent aux 8703.21.71.00 et 8703.21.79.00 que les véhicules de karting neufs et usagés répondant  
aux caractéristiques  ci-après  et importés  à l'état monté,  démonté  ou non monté  : 
- Structures  tubulaires  ; 
- Absence  de suspension  ; 
- Un ou deux moteurs monocylindriques, avec ou sans boîte à vitesse, à essence d'une cylindrée égale  
ou inférieure  à 500 cm3; 
- Transmission  de mouvement  arrière  par une  chaîne  ou une courroie  crantée  ; 
- Une direction  (colonne  simple  avec deux  petites  billettes)  ; 
- Sans  marche  arrière  ; 
- Siège  avec ou sans réglage  ; 
- Longueur  hors tout inférieure  ou égale  à 2 m ; 
- Largeur  hors tout inférieure  ou égale  à 1,5m  ; 
- Hauteur  hors tout inférieure  ou égale  à 0,7m  ; 
- Absence  de vitres  ; 
- Absence  de coffre  ; et 
- Vitesse  maximum  = 130 km/h.  

6) Dans le présent Chapitre, on entend par véhicules à technologie hybride, les véhicules à motorisation  
hybride.  
Ces véhicules  sont dotés  outre  du moteur  thermique,  d’un moteur  ou de plusieurs  moteurs  électriques  
et de batteries.  
Le ou les moteur(s) électrique(s) vont agir dans les deux situations: soit en appui du moteur thermique,  
pour donner  plus de puissance  au véhicule,  soit seul, à faible  vitesse,  permettant  au moteur  thermique  
de rester éteint  


